import { AppComponent } from './app.component';
import {HttpClientModule} from '@angular/common/http';
import { FormsModulke } from '@angular/forms';
@NgModule({
  declarations: [
    AppComponent,
    Assignmentcomponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule,
    FormsModule,
  ],
